import React from "react";

function Footer() {
  return (
    <footer>
      <div id="footer" className="footer">
        <p>
          Copyright &copy;
          document.write(new Date().getFullYear())
          Kenns Carlo Estavillo.
        </p>
      </div>
    </footer>
  );
}
export default Footer;
